  constructor(props) {
    super(props);
    this.state = {
      tData: [],
      tB: [],
    };
  }

  componentDidMount() {
    let api = fetch("(link unavailable)");
    api
      .then((x) => x.json())
      .then((y) => {
        this.setState({ tB: y });
        this.setState({ tData: Object.keys(y[0]).slice(0, 4) });
      })
      .catch((error) => console.error(error)); // Add error handling
  }

  render() {
    console.log(this.state.tData);
    return (
      <>
        <table style={{ border: "2px" }}>
          <tr>
            {this.state.tData.map((res) => (
              <th key={res}>{res}</th>
            ))}
          </tr>
          {this.state.tB.map((y) => (
            `<tr key={(link unavailable)}>
              <td>{(link unavailable)}</td>
              <td>{y.title}</td>
              <td>{y.price}</td>
              <td>{y.description}</td>
            </tr>`
          ))}
        </table>
      </>
    );
  }
}
